import React, { useState } from 'react';
import {
  Container, Typography, Box, Button, CircularProgress, Card, CardContent, Avatar, Fade, Alert
} from '@mui/material';
import PestControlIcon from '@mui/icons-material/BugReport';

function App() {
  const [file, setFile] = useState(null);
  const [preview, setPreview] = useState(null);
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleFileChange = (e) => {
    const f = e.target.files[0];
    setFile(f);
    setResult(null);
    setError(null);
    if (f) {
      const reader = new FileReader();
      reader.onload = () => setPreview(reader.result);
      reader.readAsDataURL(f);
    } else {
      setPreview(null);
    }
  };

  const handleUpload = async () => {
    if (!file) return;
    setLoading(true);
    setError(null);
    const formData = new FormData();
    formData.append('file', file);
    try {
      const res = await fetch('http://localhost:8000/predict', {
        method: 'POST',
        body: formData,
      });
      const data = await res.json();
      setResult(data);
    } catch (err) {
      setError('Prediction failed. Backend not reachable.');
    }
    setLoading(false);
  };

  return (
    <Container maxWidth="sm" sx={{ mt: 8 }}>
      <Fade in timeout={800}>
        <Box sx={{ textAlign: 'center', mb: 4 }}>
          <Avatar sx={{ bgcolor: '#1976d2', width: 72, height: 72, mx: 'auto', mb: 2 }}>
            <PestControlIcon fontSize="large" />
          </Avatar>
          <Typography variant="h3" fontWeight={700} color="primary" gutterBottom>
            Pest Detection
          </Typography>
          <Typography variant="subtitle1" color="text.secondary">
            Upload a pest image and get instant AI predictions
          </Typography>
        </Box>
      </Fade>
      <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', gap: 3 }}>
        <Button variant="outlined" component="label" sx={{ width: '100%' }}>
          Select Image
          <input type="file" accept="image/*" hidden onChange={handleFileChange} />
        </Button>
        {preview && (
          <Card sx={{ width: '100%', boxShadow: 3 }}>
            <CardContent sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
              <img src={preview} alt="preview" style={{ maxWidth: '100%', maxHeight: 240, borderRadius: 8 }} />
            </CardContent>
          </Card>
        )}
        <Button variant="contained" color="primary" onClick={handleUpload} disabled={!file || loading} sx={{ width: '100%' }}>
          {loading ? <CircularProgress size={24} /> : 'Predict'}
        </Button>
        {error && <Alert severity="error" sx={{ width: '100%' }}>{error}</Alert>}
        {result && (
          <Fade in timeout={600}>
            <Card sx={{ mt: 2, width: '100%', boxShadow: 4, borderLeft: '8px solid #1976d2' }}>
              <CardContent sx={{ textAlign: 'center' }}>
                <Typography variant="h5" color="primary" fontWeight={700}>
                  {result.class}
                </Typography>
                <Typography variant="body1" color="text.secondary" sx={{ mb: 1 }}>
                  Confidence: <b>{Math.round(result.confidence * 100)}%</b>
                </Typography>
                <Avatar sx={{ bgcolor: '#1976d2', mx: 'auto', width: 56, height: 56 }}>
                  <PestControlIcon fontSize="large" />
                </Avatar>
              </CardContent>
            </Card>
          </Fade>
        )}
      </Box>
    </Container>
  );
}

export default App;
